def calcSingleTest(f):
    line = f.readline()
    a = int(line.split()[0])
    b = int(line.split()[1])
    return findAllGood3Cnt(a, b)


def isPalindrome(x):
    strX = str(x)
    return strX == strX[::-1]


def findAllGood(m):
    good = []
    for x in xrange(1, m):
        #if (x % 10000) == 0: print x
        #if (x % 10) == 0: continue
        strX = str(x)
        str1 = strX[:-1] + strX[::-1]
        str2 = strX + strX[::-1]
        #print strX + " - " + str1 + " - " + str2
        x1 = int(str1)
        x2 = int(str2)
        sq1 = x1 * x1
        sq2 = x2 * x2
        if isPalindrome(sq1):
            good.append(sq1)
            #print str(x1) + " - " + str(sq1) + "   " + str(len(str(sq1)))
        if isPalindrome(sq2):
            good.append(sq2)
            #print str(x2) + " - " + str(sq2) + "   " + str(len(str(sq2)))
    return good


def findAllGood2(a, b):
    good = []

    def checkAndAdd(x):
        x2 = x * x
        if isPalindrome(x2):
            if(a <= x2) and (x2 <= b):
                good.append(x)
                #good.append(x2)
                #print(x2)
            return True
        else:
            return False

    def checkAndAddStr(strX):
        str1 = strX[:-1] + strX[::-1]
        str2 = strX + strX[::-1]
        #print strX + " - " + str1 + " - " + str2
        x1 = int(str1)
        x2 = int(str2)
        r1 = checkAndAdd(x1)
        r2 = checkAndAdd(x2)
        return  r1 or r2

    checkAndAdd(3)
    minLen = len(str(a)) / 4
    if minLen < 1: minLen = 1
    maxLen = len(str(b)) / 4 + 1
    #print 'a={0}, b={1}, minLen={2}, maxLen={3}'.format(a, b, minLen, maxLen)
    for l in xrange(minLen, maxLen + 1):
        for x in xrange(1 << (l - 1), 1 << l):
            s = "{0:b}".format(x)
            #print "s = " + str(s)
            if checkAndAddStr(s):
                for pos in xrange(l):
                    if s[pos] == '1':
                        tmp = s[:pos] + '2' + s[pos + 1:]
                        #print "tmp = " + str(tmp)
                        checkAndAddStr(tmp)
    return good


def findAllGood2Cnt(a, b):
    cntArr = [0, 0, 0]

    def checkAndAdd(x):
        x2 = x * x
        if isPalindrome(x2):
            if(a <= x2) and (x2 <= b):
                cntArr[0] += 1
                cntArr[1] = x
                cntArr[2] = x2
                #print(x2)
            return True
        else:
            return False

    def checkAndAddStr(strX):
        str1 = strX[:-1] + strX[::-1]
        str2 = strX + strX[::-1]
        #print strX + " - " + str1 + " - " + str2
        x1 = int(str1)
        x2 = int(str2)
        r1 = checkAndAdd(x1)
        r2 = checkAndAdd(x2)
        return  r1 or r2

    checkAndAdd(3)
    minLen = len(str(a)) / 4
    if minLen < 1: minLen = 1
    maxLen = len(str(b)) / 4 + 1
    #print 'a={0}, b={1}, minLen={2}, maxLen={3}'.format(a, b, minLen, maxLen)
    for l in xrange(minLen, maxLen + 1):
    #        if(maxLen > 10):
    #            print "len = {0} max = {1}, cnt = {2}, lastX = {3}".format(l, maxLen, cntArr[0], cntArr)
        for x in xrange(1 << (l - 1), 1 << l):
            s = "{0:b}".format(x)
            #print "s = " + str(s)
            if checkAndAddStr(s):
                for pos in xrange(l):
                    if s[pos] == '1':
                        tmp = s[:pos] + '2' + s[pos + 1:]
                        #print "tmp = " + str(tmp)
                        checkAndAddStr(tmp)
    return cntArr[0]


