def binarySearch(l, x):
    a = 0
    b = len(l) - 1
    if(x < l[0]):
        return 0
    if(x > l[b]):
        return len(l)
    while a < b:
        mid = (a + b) // 2
        midval = l[mid]
        if x == midval:
            return mid
        elif a == mid:
            return a if midval > x else b
        elif midval < x:
            a = mid
        else:
            b = mid
    return a


