def findAllGood3Cnt(a, b):
    res2 = filter(lambda x: (a <= x) and (x <= b), good0)
    left = binarySearch(good1, a)
    right = binarySearch(good1, b)
    if good1[right] == b:
        right += 1
    res = right - left
    return res


